    // const {id} = useParams()
    const [data, setData] = useState([])

    useEffect(() => {
        axios
            .get(`http://localhost:8080/api/tag/anitags/${props.id}`)
            
            .then((response) => {
                setData(response.data)
            })
            
            .catch((error) => {
                console.log('Ошибка : ',error)
            })
    }, [props.id])

